import { Link } from 'react-router-dom';

const NavBarItem = ({ item }) => {

        return (
            <div>
                <Link 
                className={`nav-item nav-link ${item.active ? "active" : ""}`}
                to={props.item.href} 
                onClick={() => item.onClick(item)}>
                {item.name}
                 </Link>
            </div>
        );
    }

export default NavBarItem;
